import './styles.css';
const pikachuImageUrl = 'https://i.pinimg.com/originals/76/47/9d/76479dd91dc55c2768ddccfc30a4fbf5.png';
export default function Card() {
  return (
    <div className='card'>
    <div>
      <img src={pikachuImageUrl}/>
      </div>
      <text>Pikachu</text>
      <text>R$26</text>
      <button>Adicionar ao carrinho</button>
    </div>
  );
}
